import React from 'react'
import styled from 'styled-components'
import Navigation from './nav'
import OverView from './overview'
import TableV2 from './table.components'
import WalletInfo from './walletInfo'

const Component = styled.div`
background: var(--background);
border-radius:10px;


.content-dashboard{
    padding: 20px 40px;
    padding-top: 70px;
}

td {
    margin: 0;
    padding: 0.5rem;
    height: 41px;
      padding-left: 10px;
  }


  thead{
    background: #F3F4FA;
    color: #9D9FAD;
    height: 41px;
    font-size: 13px;
    text-align: left;
  }

p{
    margin:0;
}

.title{ 
        font-size: 18px;
        font-weight: 500;
}
`
export default function MainBaord() {
    const columnsOccurence = React.useMemo(() => [
        {
          Header: "Order Id",
          accessor: 'orderId',

        },
        {
            Header: "Item name",
            accessor: 'itemName',

          }, {
            Header: "Status",
            accessor: 'status',

          }, {
            Header: "Created At",
            accessor: 'createdAt',

          }, {
            Header: "Updated At",
            accessor: 'updatedAt',

          },
      ], [])
    return (
        <Component>
            <Navigation />
            <div className="content-dashboard">
                 <p className='title'>
                    Overview
                </p>

                <TableV2 columns={columnsOccurence} data={[
                    {
                        orderId:'EDED-001',
                        itemName:'Tesla',
                        status:'fulfiled',
                        createdAt:'1st oct',
                        updatedAt:'1st oct'
                    }, {
                        orderId:'EDED-001',
                        itemName:'Tesla',
                        status:'fulfiled',
                        createdAt:'1st oct',
                        updatedAt:'1st oct'
                    }, {
                        orderId:'EDED-001',
                        itemName:'Tesla',
                        status:'fulfiled',
                        createdAt:'1st oct',
                        updatedAt:'1st oct'
                    }
                ]}  />
            </div>
        </Component>
    )
}
